package com.company.bazar.model;import jakarta.persistence.Column;import jakarta.persistence.Entity;import jakarta.persistence.GeneratedValue;import jakarta.persistence.GenerationType;import jakarta.persistence.Id;import lombok.Getter;import lombok.Setter;@Getter@Setter@Entitypublic class Client {    @Id    @GeneratedValue(strategy = GenerationType.SEQUENCE)    @Column(name = "id_client")    private Long idClient ;    private String nameClient ;    private  String lastnameClient;    private String dni;}